script: |
  super -f text -I q6601.spq | sort > q6601.out

inputs:
  - name: q6601.spq
    data: |
      SELECT ALL SUM ( - 81 ) AS col1 FROM tab1 (FORMAT parquet) WHERE - col0 + - ( col0 + 43 ) BETWEEN ( - 89 + - 69 * + col2 ) AND col2;
  - name: tab1

outputs:
  - name: q6601.out
    data: |
      -243
